import React, {useEffect, useState} from 'react'
import axios from 'axios'

function App() {

  const [backendData, setBackendData] = useState([{}])

  useEffect(() => {
    axios.get('/api')
    .then((result) => {
      setBackendData(result.data);
    })
  }, [])

  return (
    <div>
      <h1>리스트</h1>
      {
        (typeof backendData.users === 'undefined') ?
        (
          <p>Loading...</p>
        ) : 
        (
          backendData.users.map((user, i) => {
            <p key={i}>{user}</p>
          })
        )
      }
    </div>
  )
}

export default App
